import React from 'react';

function Home() {
  return<div><h2>
All Mars Resources</h2>
<p>Mars is no place for the faint-hearted. It’s dry, rocky, and bitter cold. The fourth planet from the Sun, Mars, is one of Earth's two closest planetary neighbors (Venus is the other).Mars is one of the easiest planets to spot in the night sky – it looks like a bright red point of light</p>
<p>Despite being inhospitable to humans, robotic explorers – like NASA's Perseverance rover – are serving as pathfinders to eventually get humans to the surface of the Red Planet.</p>

</div>;

}

export default Home;
